import React from 'react'
import { ErrorMessage, useField} from 'formik'

export const TextField = ({...props}) => {
    const [field, meta] = useField(props);
    return (
        <>
        <input className="form-control" 
         {...field}{...props} 
         autoComplete="off"
         /> 
         
         <ErrorMessage/>
        </>

        
    )
}
